sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

var str = inputs.body;
//var str = '{"Impact":"11804.347601293037","user_id":"system","NewPrice":"80.45100000000001","Frequency":"6641.016843972381","Material":"Base E27","OldPrice":"89.39"}';

var obj = JSON.parse(str);

outputs.impact = obj.Impact;
outputs.oldprice = obj.OldPrice;
outputs.newprice = obj.NewPrice;
outputs.user_id = obj.user_id;
outputs.mat = obj.Material;
outputs.freq = obj.Frequency;    

})(inputs, outputs);

